explore @missionrocksf with me❣️

I’m part of the neighborhood’s new ambassador group and they planned a fun day for us. 🤩

First stop @thecanyonsf! These luxury apartments have breathtaking views of the city. We spent time on the terrace, toured a few units, and enjoyed champagne & bites while taking cute photos, of course. 🏙️ 🥂

Second stop was the @oraclepark - hi @sfgiants - which was a short 5-minute walk. Pro tip: opt for seating at Coors Light Cove: Silver Seats for a private bar experience!! ⚾️ 🦭 

Third stop @newbelgium_sf a Colorado-based brewery where we enjoyed refreshing craft beers and more bites. FYI the flatbread here, was to die for. 🍻 🚲 

Our final stop was @atwatertavernsf located on the water and steps from all the previous stops. We arrived during magic hour and had patio seating which I think is the perfect for hosting groups for apps and cocktails! And YES they make a wonderful espresso martini. ☕️ 🍸 

Would you spend the day in @missionrocksf?
